import { PieceType, Piece } from '../../constants'
import './CapturedPieces.css'
import { useState, useEffect } from 'react';

interface Props {
    capturedWhitePieces : PieceType [];
    capturedBlackPieces : PieceType [];
}

export default function CapturedPieces ({capturedWhitePieces, capturedBlackPieces} : Props){
    const [capturedWhite, setWhiteCaptured] = useState<PieceType[]>([])
    const [capturedBlack, setBlackCaptured] = useState<PieceType[]>([])
    useEffect(() => {
        setWhiteCaptured(capturedWhite);
    }, [capturedWhite])
    useEffect(() => {
        setWhiteCaptured(capturedBlack);
    }, [capturedBlack])
    return <div><div className = 'white-captured'/>
                <div className = 'black-captured'/>
            </div>
}
